INSERT INTO `hotel` (`id`, `nom`, `ville`, `nbEtoile`, `description`, `image`) VALUES
(1, 'Novostar Budget Pyramides Club & Spa', 1, 3, 'En choisissant Hotel Les Pyramides à Nabeul, vous profiterez d\'un séjour près de l\'océan, à seulement 1 min à pied de Cape Bon et à 13 minutes de marche de Plage de Nabeul. Cet hôtel au bord de la plage se trouve à 7,5 km de Plage d\'Omar Khayam et à 8,9 km de Plage de Maamoura.', 'nnvtfp6djeogk1ohilyk.jpg'),
(2, 'Hotel Byzance', 1, 3, 'En choisissant Hotel Byzance à Nabeul, vous profiterez d\'un séjour près d\'un golf, à seulement 1 min à pied de Cape Bon et à 5 minutes de marche de Plage de Nabeul. Cet hôtel au bord de la plage se trouve à 7,3 km de Plage d\'Omar Khayam et à 9,1 km de Plage de Maamoura.', 'oda8vttckemcnwfhzzdo.jpg'),
(3, 'El Mouradi El Menzah', 2, 4, 'En choisissant El Mouradi El Menzah à Hammamet, vous profiterez d\'un séjour au cœur du quartier des divertissements, à seulement 2 min à pied de Plage de Yasmine et à 6 minutes de marche de Carthage Land (parc à thème). Cet hôtel 4 étoiles se trouve à 0,8 km de Casino La Medina et à 1,3 km de Port Yasmine.', 'El_mouradi_el_menzah_main_opdwv2.jpg'),
(4, 'Vincci Nozha Beach', 2, 4, 'En choisissant Vincci Nozha Beach and Spa à Hammamet, vous profiterez d\'un séjour au cœur du quartier des divertissements, à seulement 1 min à pied de Cape Bon et à 8 minutes de marche de Plage d\'Omar Khayam. Cet hôtel 4 étoiles se trouve à 4,6 km de Plage Bel Azur et à 6,1 km de Souk de Hammamet.', 'oin6pcjbsxsranflnq8y.jpg'),
(5, 'Hotel Bel Azur Thalasso & Bungalows', 2, 4, 'Hammamet ne manque pas de choses à découvrir : Hotel Bel Azur Thalasso & Bungalows vous fera profiter d\'un séjour près d\'un golf, à deux pas de Plage Bel Azur et Cape Bon. Ce complexe 4 étoiles se trouve à 2 km de Souk de Hammamet et à 2,3 km de Plage de Hammamet.', 'klszb6fodef4cf3lqzqa.jpg'),
(6, 'Hotel The Sindbad Hammamet', 2, 5, 'L\'hôtel Sindbad est le choix idéal si vous recherchez des vacances romantiques en couple. Vous pourrez sirotez des cocktails sur la plage privée, mais egalement profiter de soins dans le spa et diner dans un des magnifiques restaurants de l\'hôtel. La vue paradisiaque vous aidera à oublier vos petits problèmes quotidiens et vous envoutera par son charme. Vous pourrez profiter d\'un golf repondant aux critères internationaux se situe à proximité de l\'hôtel.', '9-sindbad_s5accg.jpg'),
(7, 'Golden Yasmine Mehari Hammamet', 2, 5, 'Hôtel 5*, Situé au coeur de la station touristique Yasmine Hammamet sur une vaste esplanade en front de mer, l’hôtel Méhari Hammamet Thalasso & Spa est à 60 minutes de l’aéroport international Tunis-Carthage, à 90 minutes de l’aéroport Skanès-Monastir, à 30 minutes de l’aéroport d’enfidha et à 10 minutes de la localité d’Hammamet. Méhari Hammamet Thalasso & Spa, 5 étoiles de niveau international, avec ses suites et ses chambres spacieuses, sa piscine suspendue et sa vue sur mer, rendra votre séjour à Hammamet plus agréable. Méhari Hammamet Thalasso & Spa est certifié ISO 9001 2008 (hébergement et restauration) Méhari Hammamet Thalasso & Spa est certifié ISO 22 000/2005 (Sécurité des aliments pour l’hôtel)', 'Golden_Yasmine_Mehari_Hammamet_1_hakbid.jpg'),
(8, 'Le Royal Hammamet', 2, 5, 'Le Royal Hotels & Resorts - Hammamet profite d\'un emplacement privilégié en plein cœur de Hammamet, à moins de 5 minutes en voiture de Port Yasmine et Carthage Land (parc à thème). Cet hôtel 5 étoiles se trouve à 2,4 km de Casino La Medina et à 3,9 km de Plage de Yasmine.', 'elkfc6s7cv1yb1nl3yzt.jpg');
